export const calendar = require("../assets/icons/calendar_icon.png");
export const chart = require("../assets/icons/chart_icon.png");
export const cloth_icon = require("../assets/icons/cloth_icon.png");
export const down_arrow = require("../assets/icons/down_arrow.png");
export const education = require("../assets/icons/education_icon.png");
export const food = require("../assets/icons/food_icon.png");
export const healthcare = require("../assets/icons/healthcare_icon.png");
export const menu = require("../assets/icons/menu_icon.png");
export const pin = require("../assets/icons/pin.png");
export const sports_icon = require("../assets/icons/sports_icon.png");
export const up_arrow = require("../assets/icons/up_arrow.png");
export const headerIcon= require("../assets/icons/shibainulogo.png");
export const misc = require("../assets/icons/misc.png");

export default {
    calendar,
    chart,
    cloth_icon,
    down_arrow,
    education,
    misc,
    food,
    healthcare,
    headerIcon,
    menu,
    pin,
    sports_icon,
    up_arrow
}
